package com.gxnu.entity;

import java.io.Serializable;

public class Menu implements Serializable {
	private static final long serialVersionUID = 1L;
	private int id;
    private String name;
    private int parent;
    private String url;
    private String yuliu;
	public Menu() {
		super();
		// TODO Auto-generated constructor stub
	}
	public Menu(int id, String name, int parent, String url, String yuliu) {
		super();
		this.id = id;
		this.name = name;
		this.parent = parent;
		this.url = url;
		this.yuliu = yuliu;
	}
	public Menu( String name, int parent, String url, String yuliu) {
		super();
		this.name = name;
		this.parent = parent;
		this.url = url;
		this.yuliu = yuliu;
	}
	public int getId() {
		return id;
	}
	public void setId(int id) {
		this.id = id;
	}
	public String getName() {
		return name;
	}
	public void setName(String name) {
		this.name = name;
	}
	public int getParent() {
		return parent;
	}
	public void setParent(int parent) {
		this.parent = parent;
	}
	public String getUrl() {
		return url;
	}
	public void setUrl(String url) {
		this.url = url;
	}
	public String getYuliu() {
		return yuliu;
	}
	public void setYuliu(String yuliu) {
		this.yuliu = yuliu;
	}
	@Override
	public String toString() {
		return "Menu [id=" + id + ", name=" + name + ", parent=" + parent + ", url=" + url + ", yuliu=" + yuliu + "]";
	}
	
    
}
